import React from "react";
import { Container, Row, Col} from "react-bootstrap";

function App() {
  const person = [
    {id:1, name:"احمد", date:" 5 مساء", img:'avatar.jpg'},
    {id:2, name:"محمد", date:" 5 مساء", img:'avatar.jpg'},
    {id:3, name:"نور", date:" 5 صباحا", img:'avatar.jpg'},
    {id:4, name:"خالد", date:" 10 مساء", img:'avatar.jpg'},
    {id:5, name:"وليد", date:" 7 مساء", img:'avatar.jpg'},
  ]
  return (
    <div className="color-body">
      <Container className="py-5">
        <Row className="justify-content-center my-2">
          <Col className="" sm="8">
            لديك {person.length} مواعيد اليوم
          </Col>
        </Row>
        <Row className="justify-content-center">
          <Col className="" sm="8">
            <div className="rectangle p-3">
              {
                person.length?
                person.map(per => {
                    return (
                      <div key={per.id} className="d-flex border-bottom mx-2 my-2">
                        <img className="img-avatar" src={per.img} alt="avatar"/>
                        <div className="px-3">
                          <p className="d-inline fs-5">{per.name}</p>
                          <p className="fs-6">{per.date}</p>
                        </div>
                      </div>
                    )
                  })
                :null
              }
            </div>
          </Col>
        </Row>
        <Row className="justify-content-center my-2">
          <Col className="d-flex justify-content-between" sm="8">
            <button className="btn-style">مسح الكل</button>
            <button className="btn-style">عرض الكل</button>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
